import { ContainerShirts } from "./style";

function Button({
  title,
  fontSize,
  width,
  bgColor,
  bgColorActive,
  radius,
  colorFont,
  onClick,
}) {
  return (
    <ContainerShirts
      bgColor={bgColor}
      radius={radius}
      fontSize={fontSize}
      width={width}
      bgColorActive={bgColorActive}
      colorFont={colorFont}
    >
      <button>
        <p>{title} </p>
      </button>
    </ContainerShirts>
  );
}

export default Button;
